import React from "react";
import { Switch, Route } from "react-router-dom";

import "./App.css";

import HomePage from "./pages/homepage/homepage.component";

var style = {
  display: "flex",
  justifyContent: "center",
  alignItem: "center",
  height: "100vh",
  color: "orange"
};

const HatsPage = () => (
  <div style={style}>
    <h1>HATS PAGE </h1>
  </div>
);
const Jacket = () => (
  <div>
    <h1>JACKET PAGE </h1>
  </div>
);
const Sneaker = () => (
  <div>
    <h1>SNEAKER PAGE </h1>
  </div>
);
function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/hats" component={HatsPage} />
        <Route path="/Jackets" component={Jacket} />
        <Route path="/sneaker" component={Sneaker} />
      </Switch>
    </div>
  );
}

export default App;
